static function initXformer(): SolrUtil.DigestTransformer {
  checkEnabled()
  try {
    var xml =
          "<transformer name=\"digestTransformer\" class=\"com.guidewire.solr.pc.batchload.xform.PCDigestTransformer\""
        + " algorithm=\"SHA\""
        + " ignoreElems=\"urn, periodID, policyPublicID, sliceDate, periodStart, periodEnd, "
        +                        "policyStart, policyEnd, periodIdWithSliceDate, jobType\"/>";
    return SolrUtil.makeDigestTransformer(xml)
  } catch (e : ExceptionInInitializerError) {
    e.Cause.printStackTrace()
    throw e
  }
}

function append(label : String, values : List<String>) {
  values.each(\ str -> append(label, str))
}

function append(label : String, str : String) {
  if (str != null and str.trim().length > 0) {
    buffer.add(label.toUpperCase() + "=" + str)
  }
}

property get DebugString() : String {
  return buffer.toString()
}

property get Digest() : String {
  return xformer.createDigest(buffer)
}

override function reconstructDocument(docObj : JSONObject, updatedBeans : List<KeyableBean>) : JSONObject { 
  var period = updatedBeans.firstWhere( \ b -> b typeis PolicyPeriod ) as PolicyPeriod 
  var sliceDate = Coercions.makeDateFrom(docObj.get("sliceDate"))
  period = period.getSlice(sliceDate)
  var contact = period.PNIContactDenorm

  if(PLLoggerCategory.SOLR_INDEX.TraceEnabled) {
    PLLoggerCategory.SOLR_INDEX.trace("Reconstructing document for period " + 
        period?.PublicID + " and contact " + contact?.PublicID + " ( " + contact?.Name + " )")
  }

  var result = SolrPolicyIndexDocument.createDocument(period, contact).asJSON() 

  if(PLLoggerCategory.SOLR_INDEX.TraceEnabled) {
    PLLoggerCategory.SOLR_INDEX.trace("RECONSTRUCTED : " + result.toJSONString())
  }

  return result
}

override function createKey( docObj : JSONObject, urnTag : String ) : String {
  var sb = new StringBuilder(64)
  sb.append(docObj.get("periodID"))
  sb.append('&')
  sb.append(docObj.get("sliceDate"))
  return sb.toString()
}

